import React from 'react';

const Footer = () => {
    return (
        <div className="container">
            <div className="footer">
                <div className="footer__column1"></div>
                <div className="footer__column2"></div>
                <div className="footer__column3"></div>
                <div className="footer__column4"></div>
            </div>
        </div>
    );
};

export default Footer;
